import logo from './logo.svg';
import './App.css';

function App() {
  const [noun, setNoun] = userState('Sanjana');

  const changeNoun = () => {
    setNoun('World');
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello {noun}!
        </p>
        <button onClick={changeNoun}>Change Noun</button>
      </header>
    </div>
  );
}

export default App;
